<style type="text/css">
body {
    margin: 0;
    padding: 0;
    font-family: "Inter", sans-serif;
    background: radial-gradient(circle, #280c29, #5c2b63, #3c243e);
    color: white;
    overflow: hidden;
    perspective: 1000px;
}

*, *::before, *::after {
    box-sizing: border-box;
}

.overlay {
    position: fixed;
    top: 0;
    left: 0;
    height: 100vh;
    width: 100vw;
    display: flex;
    align-items: center;
    justify-content: center;
    background: rgb(0, 0, 0);
    z-index: 999;
    transition: background-color 0.7s ease;
    overflow: hidden;
}

.scare {
    position: fixed;
    top: 0;
    left: 0;
    height: 100vh;
    width: 100vw;
    display: flex;
    align-items: center;
    justify-content: center;
}


.overlay-body {
    max-width: 600px;
    text-align: center;
    background: rgba(255, 255, 255, 0.1);
    padding: 50px;
    border-radius: 30px;
    backdrop-filter: blur(20px);
    box-shadow: 0 10px 50px rgba(0, 0, 0, 0.9);
    position: relative;
}



p.overlay-title {
    font-size: 40px;
    font-weight: 900;
    letter-spacing: 5px;
    text-transform: uppercase;
    color: #f7f7f7;
    background: linear-gradient(90deg, #ff00f2, #d400ff);
    background-clip: text;
    -webkit-background-clip: text;
    color: transparent;
    animation: neon-glow 1.5s infinite alternate;
    text-shadow: 0 0 10px rgba(255, 0, 255, 0.7);
}

@keyframes neon-glow {
    from {
        text-shadow: 0 0 10px #ea00ff, 0 0 30px #ff00ff, 0 0 50px #c300ff;
    }
    to {
        text-shadow: 0 0 20px #ff00f2, 0 0 40px #cc00ff, 0 0 80px #c300ff;
    }
}

p.overlay-description {
    font-size: 22px;
    color: rgba(255, 255, 255, 0.8);
    margin-top: 40px;
    font-weight: 400;
    text-shadow: 0 0 10px rgba(255, 255, 255, 0.3);
}

.form-control {
    position: relative;
    margin: 40px auto;
    width: 300px;
}

.form-control input {
    background-color: transparent;
    border: none;
    border-bottom: 2px solid rgba(255, 255, 255, 0.5);
    width: 100%;
    padding: 15px 0;
    font-size: 20px;
    color: #fff;
    transition: border-color 0.3s ease;
    text-shadow: 0 0 5px #d400ff;
}

.form-control input:focus, 
.form-control input:valid {
    outline: none;
    border-bottom-color: #ea00ff;
    text-shadow: 0 0 15px #f700ff;
}

.form-control label {
    position: absolute;
    top: 15px;
    left: 0;
    pointer-events: none;
    font-size: 20px;
}

.form-control label span {
    display: inline-block;
    min-width: 5px;
    color: rgba(255, 255, 255, 0.5);
    transition: transform 0.3s ease, color 0.3s ease;
}

.form-control input:focus + label span, 
.form-control input:valid + label span {
    color: #e100ff;
    transform: translateY(-30px);
}

.overlay-button {
    background: linear-gradient(90deg, #f700ff, #9900ff);
    color: white;
    font-size: 20px;
    font-weight: 700;
    padding: 15px 40px;
    border-radius: 50px;
    cursor: pointer;
    transition: transform 0.4s ease, box-shadow 0.4s ease;
    text-transform: uppercase;
    box-shadow: 0 10px 20px rgba(234, 0, 255, 0.6);
}

.overlay-button:hover {
    transform: scale(1.1) rotate(10deg);
    box-shadow: 0 20px 40px rgba(212, 0, 255, 0.8);
}

.scare video {
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    object-fit: cover;
    filter: blur(5px);
}



</style>
</head>
<body>
<div id="overlay" class="overlay">
    <div class="overlay-body">
        <p class="overlay-title">AdminPanel of Frieren</p>
        <div class="overlay-buttons-wrapper">
            <div class="form-control">
                <input id="password-input" type="password" required="">
                <label>
                    <span style="transition-delay:0ms">P</span><span style="transition-delay:50ms">a</span><span style="transition-delay:100ms">s</span><span style="transition-delay:150ms">s</span><span style="transition-delay:200ms">w</span><span style="transition-delay:250ms">o</span><span style="transition-delay:300ms">r</span><span style="transition-delay:350ms">d</span>
                </label>
            </div>
            <div id="accept-button" class="overlay-button">Вход</div>
            
        </div>
        <p class="overlay-description"><b>by pers0nal1ty</b></p>

    </div>
</div>

<div class="scare">
    <video id="video" class="video" src="video.mp4" loop></video>
</div>
